import React from "react";
import { useEffect } from "react";
import { useState } from "react";

const App = () => {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/api")
      .then((response) => response.json())
      .then((data) => {
        setBackendData(data);
      });
  }, []);

  return <div>
    {(typeof backendData === 'undefined')}
  </div>;
};

export default App;
